import React from "react";
import styled from "styled-components";

const Wrapper = styled.section`
  background: #f2f3fe;
  margin-top: 7%;
  width: 100%;
  .impact-inner {
    padding: 10% 5%;
    display: grid;
    gap: 20%;
    .impact-left {
      display: grid;
      gap: 10%;
      h4 {
        font-weight: 700;
        font-size: 20px;
      }
      h2 {
        font-size: 34px;
        line-height: 49px;
      }
      p{
        font-weight: 400;
      }
    }
    .impact-right {
      .vid {
        width: 100%;
        height: auto;
        border: 1px solid black;
        border-radius: 0 0 10px 10px;
      }
    }
  }

  @media (min-width: 768px) {
    display: flex;
    justify-content: center;
    align-items: center;
    .impact-inner {
      .impact-left {
        width: 30%;
      }
    }
  }
`;

function Impact() {
  return (
    <Wrapper>
      <div className="impact-inner">
      <div className="impact-left">
          <h4>Uncommon Impact</h4>
          <h2>
            Education = <br /> Earning Power.
          </h2>
          <p>
            Our mission is to help unemployed young adults from low-income
            communities launch their careers in the technology industry.
          </p>
      </div>
      <div className="impact-right">
        <video src="./images/vid.mp4"  controls className="vid"></video>
      </div>
      </div>
    </Wrapper>
  );
}

export default Impact;
